import React from 'react';
import TodoElement from './TodoElement';

export default function TodoContainer(props: any) {
  console.log(props);
  const { todos } = props;
  return (
    <table>
      <thead>
        <tr>
          <th>Todo Title</th>
          <th>Description</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo: any) => (
          <TodoElement props={todo} key={todo} />
        ))}
      </tbody>
    </table>
  );
}
